import React from 'react'
import { CharaList } from '../helpers/charalist'
import charaItem from '../components/charaitem'
function Charas() {
  return (
    <div class='Characters'>
        <h1>
            Characters
        </h1>
        <div className="charalist">
             {CharaList.map((Charaitem, key)=>{
                return  <charaItem key={key}
                image={Charaitem.image} name={Charaitem.name}/>
                })}
        </div>
    </div>
  );
}

export default Charas
